class WorkSpace extends Component {
  constructor(props) {
    super(props);
    this.state = {
      dataMsg: Data.map((i) => i.message),
      dataName: Data.map((i) => i.name),
      dataImg: Data.map((i) => i.image),
      dateTime: Data.map((i) => i.time),
      stateData: [...Data],
      showComponent: false,
    };
  }

  addTextChat = (msg) => {
    const newMsg = {
      image:
        "data:image/png;base64,",
      message: msg,
      name: "Milo Buevac",
      time: "Now",
    };

    this.setState({
      dataMsg: [...this.state.dataMsg, newMsg],
      dataName: [...this.state.dataName, "Milos"],
      stateData: [...this.state.stateData, newMsg],
    });
  };

  showCardComponent = () => {
    this.setState({
      showComponent: !this.state.showComponent,
    });
  };
  render() {
    const data = this.state.stateData;

    return (
      <div className="work-space">
        <WorkSpaceHeader
          handleDetails={this.props.handleDetails}
          current={this.props.current}
        />
        {this.state.showComponent && <PersonCardComponent />}
        <div className="chat-details">
          <div className="chat-component">
            {data.map((item) => (
              <ChatComponent
                showCardComponent={this.showCardComponent}
                item={item}
              />
            ))}
            <MessageInput addChatProps={this.addTextChat} />
          </div>
        </div>
      </div>
    );
  }
}

export default WorkSpace;
